import { createMuiTheme } from '@material-ui/core/styles';
import postnobillscolombo from '/static/post-no-bills/postnobillscolombo-regular.ttf';

const colombo = {
  fontFamily: 'Colombo',
  fontStyle: 'normal',
  fontDisplay: 'swap',
  fontWeight: 400,
  src: `
    local('post-no-bills'),
    local('postnobillscolombo-regular'),
    url(${postnobillscolombo}) format('ttf')
  `,
  unicodeRange:
    'U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF',
};

const theme = createMuiTheme({
  typography: {
    body1: {
      fontFamily: "colombo",
      fontWeight: 400,
      fontSize: 16,
      color: "white"
    }
  }
})

export default theme
